DROP TABLE IF EXISTS `sys_menu`;
CREATE TABLE `sys_menu` (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `parent_id` int(11) NOT NULL DEFAULT '0' COMMENT '父菜单id',
  `name` varchar(255) DEFAULT NULL COMMENT '菜单名称',
  `code` varchar(255) DEFAULT NULL COMMENT '菜单编号',
  `route` varchar(255) DEFAULT NULL COMMENT '菜单跳转路由',
  `order_num` int(4) DEFAULT NULL COMMENT '排序',
  `bdelete` varchar(1) DEFAULT '0',
  PRIMARY KEY (`Id`),
  UNIQUE KEY `uniqueCode` (`code`)
) ENGINE=MyISAM AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='会议系统菜单';

INSERT INTO `sys_menu` VALUES (1,0,'项目总览','home','/home',1,'0'),(2,0,'权属人管理','owner','/owner',2,'0'),(3,0,'安置管理','resettle','/resettle',3,'0'),(4,0,'拆运管理','transport','/transport',4,'0'),(5,0,'档案管理','archive','/archive',5,'0'),(6,0,'系统设置','setting','/setting',6,'0'),(7,6,'账户管理','user','/setting/user',1,'0'),(8,6,'权限管理','permission','/setting/permission',2,'0'),(9,6,'账户安全','security','/setting/security',3,'0'),(10,6,'日志审计','log','/setting/log',4,'0');


DROP TABLE IF EXISTS `sys_operating_log`;
CREATE TABLE `sys_operating_log` (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `user_code` varchar(255) DEFAULT NULL COMMENT '操作人',
  `type` int(4) DEFAULT NULL COMMENT '操作类型 -1删除  0 修改 1新增',
  `module` varchar(255) DEFAULT NULL COMMENT '操作模块',
  `rmk` varchar(255) DEFAULT NULL COMMENT '备注',
  `time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '操作时间',
  `bdelete` char(1) DEFAULT '0',
  PRIMARY KEY (`Id`)
) ENGINE=MyISAM AUTO_INCREMENT=1330 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='操作日志';

