DROP TABLE IF EXISTS `sys_param`;
CREATE TABLE `sys_param` (
  `code` varchar(255) NOT NULL DEFAULT '' COMMENT '参数编号',
  `value` varchar(255) DEFAULT NULL COMMENT '值',
  `name` varchar(255) DEFAULT NULL COMMENT '参数名称',
  `unit` varchar(255) DEFAULT NULL COMMENT '单位',
  `bdelete` varchar(1) DEFAULT '0',
  PRIMARY KEY (`code`)
) ENGINE=MyISAM AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 COMMENT='系统参数';


INSERT INTO `sys_param` VALUES ('error_login','3','错误登录','次','0'),('error_login_lock_time','3','锁定时间','分钟','0'),('login_timeout','5','系统超时','分钟','0');




DROP TABLE IF EXISTS `sys_role`;
CREATE TABLE `sys_role` (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(50) DEFAULT NULL COMMENT '名称',
  `level` int(4) DEFAULT NULL COMMENT '角色等级，等级确定权限',
  `bdelete` char(1) DEFAULT '0',
  PRIMARY KEY (`Id`)
) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='系统角色';

INSERT INTO `sys_role` VALUES (1,'管理员',1,'0'),(2,'普通用户',2,'0');



DROP TABLE IF EXISTS `sys_role_button`;
CREATE TABLE `sys_role_button` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `menu_code` varchar(225) NOT NULL DEFAULT '0' COMMENT '菜单code',
  `role_id` int(11) NOT NULL DEFAULT '0' COMMENT '角色ID',
  `create_flag` varchar(1) DEFAULT NULL COMMENT '新增',
  `update_flag` varchar(1) DEFAULT NULL COMMENT '修改',
  `auth_flag` varchar(1) DEFAULT NULL COMMENT '审核/审批',
  `del_flag` varchar(1) DEFAULT NULL COMMENT '删除',
  `query_flag` varchar(1) DEFAULT NULL COMMENT '查询',
  `custom` varchar(1000) DEFAULT NULL COMMENT '自定义权限',
  `print_flag` varchar(1) DEFAULT NULL COMMENT '打印',
  `upload_flag` varchar(1) DEFAULT NULL COMMENT '上传',
  `download_flag` varchar(1) DEFAULT NULL COMMENT '下载/导出报表',
  `create_user` int(11) DEFAULT '0' COMMENT '录入人ID',
  `create_time` datetime DEFAULT NULL COMMENT '录入时间',
  `update_user` int(11) DEFAULT '0' COMMENT '修改人ID',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `bdelete` varchar(1) NOT NULL DEFAULT '0' COMMENT '是否删除标记',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=25 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='菜单按键权限表';

